import React, { Component } from 'react';
import PropTypes from 'prop-types';


class Greeting extends Component {

    constructor(props){
        super(props)
        this.state={
            age: 32
        }
    }


    render() {
        return (
            <div>
                <h1>
                HOLA { this.props.name } !
                </h1>
                <h2>
                    Tu edad es : { this.state.edad }
                </h2>
            </div>
        );
    }
}


